import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';
import NutritionT from '../nutrition';

export default class Routes extends Component {
    render() {
        return (
            <Switch>
                <Route exact path='/nutrition'>
                    <NutritionT />
                </Route>
            </Switch>
        )
    }
}
